Save Simbachka is a casual puzzle game. You draw lines with your finger to create a wall that protects Simba from bees and other dangers. You need to protect Simba with a painted wall from all dangers for a few seconds, hold out and you will win the game. Use your wits to save Simba the cat.

How to play:
1. Paint of the screen to create a line to protect Simba;
2. As long as you don't let go of your finger, you can always draw a line further until the ink runs out;
3. You can release your finger and finish drawing the line there if you think that it will protect Simba;
5. Wait the specified time on the level so that the bees fly away;
6. Hooray! You have passed the level!

Game Features:
1. Different enemies;
2. Many bright and beautiful levels;
3. Simba's funny expressions;
4. Various hats worn by Simba;
5. Posters in place that unlock new hats.

Good luck and have fun playing!

Introducing MultiCraft ― world of unlimited opportunities! Get ready for real Adventures!

Build and Destroy Blocks. Get Resources and Create Various Tools, Blocks and Weapons with which you can Survive and create unique Buildings.

Choose your side in this world ― a Builder (Creative mode) or a Ruthless Hunter, who will do everything to stay alive (Survival mode)!

► Be careful, in this world not only peaceful Animals, but an awful Monsters too! Win a battle with them and you will get priceless resources!
► Swim across the seas for new lands and resources ― lands are unlimited. Exploration them!
► If you decided to Survive ― keep eye on hunger and fill out it in time! Search for food, grow plants and kill mobs for meat!
► Built your shelter from the monsters and you will survive this night! They are coming for you… Zombies, Skeletons, Huge Spiders and other hostile mobs.
► At any time you can fly to the skies with the «Fly» mode or become fast as flash with the «Fast» mode.
► You can save your Home Point, create Waypoints, and change the Time of Day. Play by your own rules, because it's your own world!

In this game your actions are unlimited only by your imagination! The game does not require any skills ― you can at all understand in the first minutes of the game. With MultiCraft you can spend good time everywhere and every time! And it’s totally FREE!

Do you want to play with your friends? Join one of the many custom servers («Multiplayer» tab) or create your own («Host Server» tab) for free. The game has a constantly updated list of various servers. You're sure to find one you like!

In our game you are expected:
► Cows, pigs, sheep and other peaceful mobs;
► Wolves and Dogs;
► Huge and Small Spiders;
► Insidious Skeletons with Bows;
► Strong Zombies and other hostile mobs;
► Red and Blue ore, mechanisms and hoppers;
► A realistic game process;
► Pandas, Penguins and Seals;
► Chickens, that carry eggs;
► Stable FPS and drawing world without lag;
► High game optimization and the generation of the world for all modern devices;
► Many different biomes and a unique relief of the world;
► A large number of different foods and plants;
► Crafting Guide with a list of all items and recipes;
► Completely revised for easy touch controls of the game;
► Singleplayer with Survival and Creative modes;
► Easily change the game mode in the Main Menu;
► Accelerated flight and walking;
► Multiplayer mode on many free servers.
► Free creation of your own server to play with your friends directly in the game menu.

Driving Zone: Germany - street racing simulator on the cars produced in Germany.

In this game are presented cars of the German manufacturers: from classic city cars to powerful modern sports cars and luxury cars. Each car in the game has it's own technical specifications and engine sounds. Well detailed body and dashboard create the effect of full presence and realism.

The game offers four unique tracks with different weather conditions. You can drive on high-speed highway, or go for a ride in the German town, which is particularly beautiful at night. If you are a real extreme racer, you should drive on winter track with dangerous icy road. You can choose the starting time of the day, that will change dynamically.

Start the engine, press down on the gas and chase as quickly as possible. Earn points by overtaking traffic cars, you need them to open the new vehicles, modes and other features of the game.

This racing simulator gives you the ability to choose the style of driving that can be tranquil and safe or extremely racing. The abundance of settings allows you to customize a level of car physics realism, from arcade and simple to the most realistic, as in the difficult racing simulator in which you will need to show your driving skills.

Record your gameplay videos and share them to your friends in social networks with Everyplay Service. You can edit recorded video replays and comment them using the camera and microphone on your device.

Features:
- Modern beautiful graphics;
- Realistic car physics;
- Change the time of day in real-time;
- Qualitatively modeled German cars;
- 4 tracks with different weather conditions;
- First person view / interior camera.

Warning! This game is quite realistic, but it is not designed to teach you how to street racing. Be careful and responsible when you're driving real car. Enjoy virtual driving in heavy car traffic, but please observe the traffic rules and be careful on real roads.

A multiplayer third-person shooter starring mechanical titans created by professional developers. True console gaming is now available on your mobile device! Obliterate your enemy with superior tactics and firepower at the touch of your fingertips!

“We now have a perfect mobile shooter where your proficiency in battle depends on skill and tactics.” - LiveCraft

Red Button's team are GameDev veterans and are proud to bring you their latest masterpiece.
Key features:
— Light, Medium, and Heavy titans of different kinds. You can find here anything from reworks of traditional bipedal robots up to next-gen “mech-arachnids” that are able to climb any terrain;
— Distinctive team roles: support/artillery, tank, assault, and scout. Choose what you prefer the most;
— Rocket launchers, machine guns, and railguns. Assault the enemy with everything from heavy submachine guns up to an orbital strike made by the interplanetary dropship;
— Customizable experience. Swap out more than just your weapons - you can modify everything from armor plating to chassis enhancements! Over 150 combinations of upgrades personalize your titan by affecting its speed, durability, and even the overall look of your walking deadly fortress;
— Tomorrow's world in today's physics. Unreal Engine 4 allows us to get the physics of our war machines just right, delivering a high-tech, realistic battle simulator; 
— Small gaming sessions 6-10 minutes long. It is a real adrenaline injection that's always in your pocket. You can play wherever and whenever you want: from your favorite comfy couch to a quick match while travelling.

Sounds like your kind of fun? It's free to play, so what are you waiting for? Join us on the battlefield, Pilot!

